eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst English = {\n    header: 'What to do?',\n    content: 'What to do if you have muscle pain and what to discuss with your doctor.',\n    and: 'and',\n    or: 'or',\n    here: 'here',\n    hereCap: 'Here',\n    page: 'this page',\n    article: 'this article',\n    website: 'this website',\n    like: 'like',\n    based: 'based on',\n    some: 'some',\n    meds: 'Medications:',\n    medP: \"I do recommend consulting with your physician before taking any medication as what works for one person might be not suitable for another and some drugs should be taken only under the doctor's supervision. Also, some medications could not be used all the time, but only temporarily for calming down increased pain. Not all medications could be combined and combine carefully herbal supplements and drugs (better ask your pharmacist what and how could be combined). Please, keep in mind that all medications negatively impact the heart, liver, kidneys and stomach. Some have such side effects as drowsiness and dizziness (for example, amitriptyline, cyclobenzaprine, opioids).\",\n    cannabis: 'cannabis-derived drugs.',\n    cannabisdesc: \"\",\n    nsaids: 'nonsteroidal anti-inflammatory drugs (NSAIDs)',\n    ibuprofen: 'ibuprofen-like group (ibuprofen, ketoprofen, naproxen, nimesulide, etc.), paracetamol/acetaminophen (also available in a combination with caffeine), dexketoprofen, aspirin, analgin',\n    nsaidspart1: 'that are available over the counter or in prescription strength. Here belong',\n    nsaidspart2: 'You could read more about painkillers and NSAIDs',\n    meditem1: 'Personally, I take 1000 mg paracetamol/acetaminophen + caffeine if the pain is progressing, nimesulide if it feels like fever and my forehead, neck and shoulders are sore and hot, dexketoprofen when I feel strong pain but without this fever-like feeling.',\n    cyclobenzaprine: 'cyclobenzaprine',\n    meditem2: 'is a muscle relaxant, could be used for the temporary decrease of worsened pain. For more information, please, visit',\n    amitriptyline: 'some antidepressants (amitriptyline)',\n    amitriptylineP: 'help to manage chronic pain even without depression. More information about amitriptyline could be found',\n    meditem3: 'Please, be aware, that antidepressants tend to make one emotionally somewhat indifferent to most things. Some people describe it as not living but just existing, more about it could be read from',\n    opioids: 'opioids',\n    codeine: 'codeine',\n    meditem4: '(often they go in combination with paracetamol/acetaminophen and caffeine for better effect). In my case, the doctor said: \"If you are not able to fall asleep because of severe pain, you could try opioids, but they would not treat the pain.\" And she was absolutely right. Moreover, narcotic-based drugs are dangerous as they cause addiction, with time a higher and higher dose is needed to help. In my case, they helped me to sleep only for the first time I tried, but the next couple of days my head was spinning around so much, that I could barely walk straight. Thus, I would recommend avoiding taking opioids as in case of muscle pain (same as neurological pain) there are better alternatives. More information about addictive painkillers could be found',\n    cannabis: 'cannabis-derived drugs',\n    meditem5: 'also might be tried if the pain is enormous as they have a relaxing effect. More information about the FDA cannabis research could be read',\n    cannabisP: 'Personally I have never tried cannabis-derived drugs, hence I could not say anything about their effectiveness.',\n    antiseizure: 'antiseizure medication',\n    benzodiazepines: 'benzodiazepines',\n    meditem6: 'also could be helpful as they lower brain activity and are prescribed to treat conditions such as anxiety, insomnia, and seizures. Personally I have never had any experience with these drugs. For more information, please, visit',\n    ointment: 'patches or ointment',\n    diclofenac: 'diclofenac, ibuprofen, nimesulide',\n    meditem7: 'could be applied locally (on the skin) in areas with pain. For more information, please, visit',\n    anesthetics: 'local anesthetics',\n    anestheticsP: 'like ointment or spray based on',\n    lidocaine: 'lidocaine',\n    lidocaineP: 'could be applied in case of emergency. More information could be found',\n    meditem8: 'Personally I prefer the alternative methods discussed below in the next sections instead of using local anesthetics.',\n    food: 'Food supplements:',\n    foodP: 'I would also recommend discussing what food supplements would be great for you with your physician. You may do a blood test to find out what your body is lacking, which should be discussed with your doctor. And also make sure different food supplements you are going to take can be combined and medication you are taking (if any). Some food supplements could cause allergies, please, consider that as well.',\n    complexes: 'muscle-bones-joints complexes',\n    supplements: 'Supplements to support muscle tissues are',\n    supplementsN: 'L-Glutamine, MSM, collagen, Coenzyme Q10 (Ubiquinone)',\n    supplementsP: 'Also if you take NSAIDs',\n    omega: 'Omega-3',\n    fooditem1: '(which is especially beneficial for the heart and kidneys) could be helpful',\n    magnesium: 'magnesium',\n    fooditem2: 'relaxes muscles',\n    fooditem3: 'is quite important for the normal function of multiple organ systems (including kidneys)',\n    homeopathy: 'homeopathy with',\n    salts: 'cell salts',\n    fooditem4: 'helps some people to get some pain relief, but it does not work immediately. For more information, please, visit',\n    melatonin: 'melatonin',\n    tryptophan: 'L-Tryptophan',\n    tryptophanP: 'is changed into serotonin, that supports positive mood and relaxation',\n    fooditem5: 'if you have trouble with falling asleep (my personal preference is 10 mg). There are also supplements melatonin + L-Tryptophan',\n    passionflower: 'passionflower',\n    ashwagandha: 'withania somnifera (ashwagandha)',\n    fooditem6: 'extract works for calming down and stress relief, hence could be helpful for sleep issues too',\n    rhodiola: 'rhodiola rosea',\n    adaptogen: 'is a great adaptogen',\n    ginkgo: 'ginkgo biloba',\n    fooditem7: 'contains antioxidants and promotes proper blood circulation, both could help to support muscle tissues health and not just that, and these herbs could be combined. Also, you could find the herbal complex with rhodiola rosea, ginkgo biloba and ginseng, but, please, keep in mind that',\n    ginseng: 'ginseng',\n    ginsengP: 'increases the blood pressure a bit',\n    fooditem8: 'something to support your gastro and heart health if you constantly take painkillers.',\n    lecithin: 'Lecithin',\n    lecithinP: 'is good for the liver and gallbladder',\n    aloe: 'aloe',\n    aloeP: 'could be used to help your stomach',\n    hawthorns: 'hawthorns',\n    hawthornsP1: 'usually combined with',\n    hawthornsP2: 'tinctures in a proportion 1:1:1) could help to restore heart health',\n    valeriana: 'valeriana',\n    leonurus: 'leonurus',\n    astragalus: 'Astragalus',\n    astragalusP: 'is well known for kidney support, but personally, I have never tried it',\n    diet: 'Diet:',\n    dietP: 'I recommend discussing your diet with your dietologist.',\n    nutrition: 'nutrition',\n    nutritionP: 'make sure your body receives proper',\n    dietitem1: 'especially your brain as it controls the whole body. More information could be read',\n    proper: 'proper',\n    hydration: 'hydration',\n    dietitem2: 'is essential for kidney health, especially considering that taking medication impacts them',\n    teas: 'calming herbal teas',\n    teas2: 'lavender and mint',\n    dietitem3: '(as they relax muscles and have an anti-inflammatory effect), especially I like',\n    teaP: 'tea in a proportion 1:1 as these herbs are also strong regenerators',\n    seaweeds: 'seaweeds like',\n    chlorella: 'chlorella',\n    spirulina: 'spirulina',\n    dietitem4: 'have impressive nutritional profiles and aid detox',\n    mushrooms: 'mushrooms',\n    mushroomsP: 'should not be left without attention as well. For more information, I would suggest visiting',\n    stamets: \"Paul Stamets' website\",\n    dietitem5: 'as I find him a great mycologist and I liked his products by myself.',\n    alternative: 'Alternative ways:',\n    alternativeP: 'These are my habits, up to you to consider or not.',\n    ice: 'ice in the towel',\n    iceP: 'I wrap 3-4 small cubes of',\n    alternativeitem1: 'to chill down heated up muscles and thus to decrease the pain. But make sure to wrap ice in the cloth in such a way so that it wouldn&apos;t cool your muscles too much. It should be felt like something a bit chilly, not cold. Also, you make keep switching applying and removing such cloth with ice to make sure to prevent frostbite',\n    outside: 'going outside in chill weather and taking a warm shower right afterward',\n    alternativeitem2: 'as chilly air makes you feel more awake and warm water then relaxes your body. But if there is a sharp temperature contrast personally I lose consciousness',\n    applying: 'applying',\n    wrap: 'cooling neck and shoulders wrap',\n    herbs: 'with herbs',\n    massage: 'gentle massage',\n    alternativeitem3: 'could be helpful sometimes. For more information, please, visit',\n    walking: 'walking in nature',\n    alternativeitem4: 'at least several times a week to get more oxygen of better quality',\n    mixture: 'a mixture of massage oils',\n    recipe: 'on sore muscles, here is my recipe',\n    recipeP1: 'mix jojoba or argan cosmetic oil (or any other gentle non-comedogenic basic oil) with essential oils in a proportion 10:1,',\n    recipeP2: 'the essential oils I am using are lavender and peppermint in a proportion 1:1.',\n    physiotherapy: 'Physiotherapy:',\n    physiotherapyP: 'I would advise getting yoga and fitness instructors to get an individual set of exercises and to make sure you are doing exercises correctly to prevent damaging muscles. Also, I would recommend skipping doing bodybuilding with iron as it does not stretch muscles but only leads to their over-usage. And when you have chronic muscle pain you need to make your muscles contract and relax properly.',\n    yoga: 'yoga',\n    physiotherapyitem1: 'some useful exercises you could find',\n    bands: 'resistance bands',\n    bandsP: 'exercises with',\n    physiotherapyitem2: 'If you are already experienced with these bands, I would recommend',\n    podcast: 'podcast (many thanks to which from my side)',\n    stretching: 'stretching muscles',\n    physiotherapyitem3: 'when the pain is not progressing',\n    adidas: 'are some pieces of advice by Adidas'\n};\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (English);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./posts/en/what-to-do.js\n");

